import React from 'react';
import Card from 'react-bootstrap/Card';

const PersonCard = props => {
    return (
        <Card style = {styles.cardLayout}>
            <Card.Body>
                <Card.Title>{props.name}</Card.Title>
            </Card.Body>
        </Card>
    );
}

let styles = {
    cardLayout: {
        padding: "20px;",
        margin: "20px;"
    }
}

export default PersonCard;
